myApp.controller('LoginController', function ($scope, $q, $rootScope, $http, $translate, AppContext, Enum) {

    //var span = jQuery("<span/>");
    //span.append(jQuery("<span/>"));
    //alert(span.prop("outerHTML"));

    $scope.isAndroid = ons.platform.isAndroid();
    var value = window.localStorage.getItem("theme");

    //set theme
    switch (value) {
        case "darkTheme":
            theme = 'lib/onsen/css/onsen-css-components-dark-theme.css'; break;
        case "sunshineTheme":
            theme = 'lib/onsen/css/onsen-css-components-sunshine-theme.css'; break;
        case "blueTheme":
            theme = 'lib/onsen/css/onsen-css-components-blue-theme.css'; break;
        case "purpleTheme":
            theme = 'lib/onsen/css/onsen-css-components-purple-theme.css'; break;
        default:
            theme = 'lib/onsen/css/onsen-css-components-blue-basic-theme.css'; break;
    }
    $('#themeScript').attr('href', theme);
    
    //set remember me
    if (window.localStorage.getItem("rememberMe") == "true") {
        $scope.userEmail = window.localStorage.getItem("userName");
        $scope.userPassword = window.localStorage.getItem("password");
        document.getElementById("rememberMe").checked = true;
    }
    else {
        document.getElementById("rememberMe").checked = false;
    }

    //set language
    var lang = window.localStorage.getItem("lang");
    $translate.use( lang == null ? 'en' : lang);

    ons.ready(function () {

        

        //get app version
        if (device.isVirtual != undefined) {
            cordova.getAppVersion(function (version) {
                
                window.localStorage.setItem("AppVersion", version);
                $scope.versionNumber = version;
                $scope.$apply();
            });
        }
        
        AppContext.setUserContext(null);
        $rootScope.AppName = "Navotar Mobile";

        $scope.Login = function (val) {

            if (document.getElementById("rememberMe").checked == true) {
                window.localStorage.setItem("rememberMe", "true");
                window.localStorage.setItem("userName", $scope.userEmail);
                window.localStorage.setItem("password", $scope.userPassword);
            }
            else if (document.getElementById("rememberMe").checked == false) {
                window.localStorage.setItem("rememberMe", "false");
                window.localStorage.setItem("userName", "");
                window.localStorage.setItem("password", "");
            }
            AppContext.setBaseUrl();
            var request = {
                method: 'POST',
                //url: AppContext.baseUrl + 'User.svc/login/' + $scope.userEmail + '/' + $scope.userPassword + '/1.1.1.1',
                url: AppContext.getUrl(Enum.Url.Login, [1, 'xyd', true]),
                data: {
                    userName: $scope.userEmail,
                    password: $scope.userPassword,
                    ip: '1.1.1.1'
                },
                headers: {
                    'Content-Type': 'application/json',
                    'Accept': 'application/json'
                }
            }
            $scope.validateForm = function (form) {
                if (form.$valid) {
                    $('#loginLoadingMsg').css('display', 'block');
                        notificationModal.show();
                        $('#dismissButton').css('display', 'none');
                        $('#loginErrorMessage').text("");

                        setTimeout(function () {
                            $('#loginLoadingMsg').css('display', 'none');
                            $('#loginErrorMessage').text("Timed out please try again");
                            $('#dismissButton').css('display', 'block');
                        }, 20000);

                        $http(request).then(
                         function (response) {
                             if (response.data.ClientId == 0) {
                                 notificationModal.hide();
                                 console.log(request.url + "Login failed!");
                                 ons.notification.alert({ message: 'User name or Password is incorrect!!', title: 'Login Failed', animation: 'slide', buttonLabel: 'Try Again' });
                             } else {
                                 notificationModal.hide();
                                 AppContext.setUserContext(response.data);
                                 $scope.$root.$broadcast("profile", response.data);
                                 menu.setMainPage('home.html', { animation: defaultTransition });
                                 //$scope.LoginNavigator.pushPage('home.html', { animation: defaultTransition });
                             }
                         },
                         function (error) {
                             console.log("error : " + error);
                             $('#loginLoadingMsg').css('display', 'none');
                             $('#loginErrorMessage').text("Error Occured, Try Again");
                             $('#dismissButton').css('display', 'block');
                         });
                }

            };
            $scope.dismiss = function () {
                notificationModal.hide();
                $('#loginLoadingMsg').css('display', 'block');
                $('#dismissButton').css('display', 'none');
                $('#loginErrorMessage').text("");
            };
            if (val == "userName" || val == "buttonPress") {
                $("#userName").fadeOut();
                $("#userName").fadeIn();
            }
            if (val == "password" || val == "buttonPress") {
                $("#password").fadeOut();
                $("#password").fadeIn();
            }

        };
    });
});

